import{_ as i,c as t,o as e,a as l}from"./app.f7b0898d.js";const u=JSON.parse('{"title":"git","description":"","frontmatter":{},"headers":[{"level":2,"title":"git命令","slug":"git命令","link":"#git命令","children":[]},{"level":2,"title":"如何解决分支合并时的冲突问题","slug":"如何解决分支合并时的冲突问题","link":"#如何解决分支合并时的冲突问题","children":[]},{"level":2,"title":"如何进行协同开发","slug":"如何进行协同开发","link":"#如何进行协同开发","children":[]}],"relativePath":"interview/常见问题大杂烩/git.md"}'),a={name:"interview/常见问题大杂烩/git.md"},r=l('<h1 id="git" tabindex="-1">git <a class="header-anchor" href="#git" aria-hidden="true">#</a></h1><h2 id="git命令" tabindex="-1">git命令 <a class="header-anchor" href="#git命令" aria-hidden="true">#</a></h2><p><strong>用git进行本地化的操作</strong></p><ul><li>git init 初始化git仓库</li><li>git add./git add* 将修改提交到暂存区(可以多次提交)</li><li>git commit -m &quot;描述&quot;将暂存区的修改存储到历史区</li><li>git checkout +文件名称 将暂存区撤销回工作区</li><li>git reset --hard 版本号 将历史区的某个版本展示到工作区</li><li>git status 查看当前的状态</li><li>git log 查案版本记录</li></ul><p><strong>git进行远程仓库</strong></p><ul><li>git clone 仓库地址 将远程仓库克隆到本地</li><li>git pull 将远程仓库最近版本拉取合并到本地仓库</li><li>git push 将本地仓库的最新版本推送到远程和远程仓库进行合并</li></ul><p><strong>git分支操作</strong></p><p>本地分支</p><ul><li>git branch 分支名称 创建一个本地分支</li><li>git checkout 分支名称 切换到某个分支</li><li>git checkout -d 创建并切换分支</li><li>git merge 分支名称 将某个分支合并到当前分支</li></ul><h2 id="如何解决分支合并时的冲突问题" tabindex="-1">如何解决分支合并时的冲突问题 <a class="header-anchor" href="#如何解决分支合并时的冲突问题" aria-hidden="true">#</a></h2><p>先尝试将冲突的代码手动合并，如果想要暂时保存自己的修改，可以将修改暂存起来，git stash/git stash save 将没有提交的修改缓存下来并删除</p><h2 id="如何进行协同开发" tabindex="-1">如何进行协同开发 <a class="header-anchor" href="#如何进行协同开发" aria-hidden="true">#</a></h2><p>选择平台(gitee coding) 创建团队、创建项目、创建代码仓库、为每位成员建立分支、定义规范</p><p>每天进行分支的合并和冲突的解决，测试并检查当天项目的问题，再分配问题，由成员解决</p>',14),g=[r];function n(s,d,o,c,h,p){return e(),t("div",null,g)}const m=i(a,[["render",n]]);export{u as __pageData,m as default};
